    getReportDataCallBack(data) {
        this.isReportDataLoading = false;      
        if (Util.checkResponse(data)) {
            this.reportData = data.resultData;
            this.reportDes = this.reportData.rptReportDesc;
            this.reportParams = this.reportData.listReportParams;
            this.sendDataToComponent( { 'description': this.reportDes,'paginationFlag':this.reportData.rptPaginationFlag});
            if (this.reportData.rptParamCount > 0) {
                this.createReportControls();
                this.loadReportForm();
                if (Object.keys(this.formControlData).length) {
                  this.setFormControlValueManually();
                }
            }
        } else {
            this.sendDataToComponent( { 'description':null,'paginationFlag':null});
            console.log('Error: ' + data.responseMsg);
        }
    }

