    autoCompleteMethodEvent(item, paramData, ind, control) {
        this.autoCompleteParamData = paramData;
        if (item == undefined || item == null || item == '') {
            return;
        }
        if (item.isDependentParam == true) {
            var jsonReq = {
                'childType': "Auto",
                'token': this.autoCompleteParamData.query,
                'value' :(typeof item.parentValue[0] === "object"  ? item.parentValue[0].key : item.parentValue[0]),
                'methodName': item.prmListName
            };
            this.restService.postRequestWithParamater('loadDependentList', jsonReq,false).subscribe(data => { 
                this.autoCompleteMethodEventCallBack(data, ind) 
            });
        } else {
            let jsonReq = {
                'token': this.autoCompleteParamData.query,
                'methodName': item.prmListName
            };
            this.restService.postRequestWithParamater('loadAutoCompleteList', jsonReq,false).subscribe(data => { 
                this.autoCompleteMethodEventCallBack(data, ind)            
            },err=>{
                let data = this.sharedService.testData['LoadAutoComplete'];
                console.log(data);
                this.autoCompleteMethodEventCallBack(data, ind);        
            }
        );
        }
    }

