    convertDateToString(data) {
        if (data != undefined && data != null && data != '') {
            var date = new Date(data);
            var day = ('0' + date.getDate()).slice(-2);
            var month = ('0' + (date.getMonth() + 1)).slice(-2);
            return [day, month, date.getFullYear()].join('/');
        }
        return null;
    }

    convertTimeToString(data) {
        if (data != undefined && data != null && data != '') {
            var date = new Date(data);
            var hour = ('0' + date.getHours()).slice(-2);
            var minute = ('0' + date.getMinutes()).slice(-2);
            var second = ('0' + date.getSeconds()).slice(-2);
            return [hour, minute, second].join(':');
        }
        return null;
    }

    concatMultiSelectList(data) {
        if (data != undefined && data != null && data != '') {
            var concatString = '';
            if (data != undefined && data != null && data != '' && data.length > 0) {
                var string = '';
                for (let i = 0; i < data.length; i++) {
                    string += data[i].key + '~';
                }
                var lastChar = string.slice(-1);
                if (lastChar == '~') {
                    concatString = string.slice(0, -1);
                }
            }
            return concatString;
        }
        return null;
    }

    resetButtonClickEvent() {
        this.reportActionForm.reset();
        //this.loadReportForm();
    }

    createReportControls() {
        this.reportParams.forEach((ele, ind) => {
            ele['seq'] = 0;
            this.cssClass[ind] = { cls: '' };
        });

        /* FOR DISPLAYING OR OPERATOR AS STRING ON UI IN CASE OF OR CONDITION ADDED  290719  */
        if (this.reportData.listReportOperator && this.reportData.listReportOperator.length > 0) {
            let rptOperatorArray = this.reportData.listReportOperator;
            rptOperatorArray.forEach(ele => {
                let leftOpe = Number(ele.opdLhsOperand);
                let fieldInd = this.reportParams.findIndex((ele) => {
                    return ele.prmParamId == leftOpe;
                });
                this.reportParams[fieldInd].isLHS = 1;
            });
        }

        /* FOR INNER ALIGN ELEMENT SIDE BY SIDE ADDED 290719  */
        if (this.reportData.listReportLayout && this.reportData.listReportLayout.length > 0) {
            let rptLayoutArray = this.reportData.listReportLayout;
            for (let c = 0; c < rptLayoutArray.length; c++) {
                let alignEdItems = rptLayoutArray[c]['rldAlignedParamId'];
                let spiAlignEdItems = alignEdItems.split(",");
                let tmp = 1;
                spiAlignEdItems.forEach(fieldsNum => {
                    let ind = this.reportParams.findIndex(function (element) {
                        return element.prmParamId == Number(fieldsNum);
                    })
                    if (ind != -1) {
                        this.reportParams[ind]['seq'] = tmp;
                        tmp++;
                    }

                });
            }
        }

        /* FOR CREATING ELEMENT BY ADDING IT INTO CONTROL DYNAMICALLY 300719  */
        this.reportParams.forEach(ele => {
            let validatorsArray = [];
            let obj = {
                value:'',
                disabled:true
            }  
            if (ele.prmMandatoryFlag != undefined && ele.prmMandatoryFlag != null && ele.prmMandatoryFlag == 'Y') {
                validatorsArray.push(Validators.required);
            }
            if (ele.prmRegex != undefined && ele.prmRegex != null && ele.prmRegex != '') {
                validatorsArray.push(Validators.pattern(ele.prmRegex));
            }
            if (ele.prmMinVal != undefined && ele.prmMinVal != null && ele.prmMinVal != '') {
                validatorsArray.push(Validators.min(ele.prmMinVal));
            }
            if (ele.prmMaxVal != undefined && ele.prmMaxVal != null && ele.prmMaxVal != '') {
                validatorsArray.push(Validators.max(ele.prmMaxVal));
            }
            if (ele.prmEnabledFlag=="Y") {
                obj.disabled = false;
            }
            if (ele.prmParamType=="Time") {
                validatorsArray.push(Validators.pattern("^([0-1]?[0-9]|[2][0-3]):([0-5][0-9])(:[0-5][0-9])?$"));
            }
           
            this.reportActionForm.addControl('formControlName' + ele['prmParamId'], new FormControl(obj, validatorsArray));
        });
        this.reportViewParams = this.reportParams;        
    }

    setTime($event, formcontrol) {
        this.reportActionForm.controls[formcontrol].setValue(moment($event.value).format('HH:mm:ss'));
        let time = moment($event.value).format('HH:mm:ss');
        $event.input.value = time.toString();
    }

