    fileUpload(event) {
        let reader = new FileReader();   
        if (event.files && event.files.length > 0) {
            let file = event.files[0];
            reader.readAsDataURL(file);
            reader.onload = () => {
                if (reader.result) {
                    this.fileArray.push({
                        fileFormat: file.name.split('.').pop(),
                        fileName: file.name,
                        fileData: (<string>reader.result).split(',')[1]
                    })
                }                
            };           
        }
    }
